Plot: Following charges of corruption, Colva's (Goa) Police Inspector Rakesh Kadam kills himself, leaving a devastated wife, Megha, and son, Nitin. She takes it upon herself to canvas support that her husband was framed by a gangster, Jaykant Shikre, and vainly insists on a CBI Inquiry. When the High Court requires Jaykant, on unrelated charges, to present himself at Shivgad Police Station, which is located at the borders of Maharashtra and Karnataka, he refuses to do so, and the local Inspector Bajirao Singham, who has recently fallen in love with stunning Kavya Bhosle, summons him. An enraged Jaikant does appear along with an army of goons, but is no match for Bajirao, who has support from the entire community. Humbled and humiliated, Jaykant returns to Goa, and ensures Bajirao gets transferred there. It is here he not only plans to use an army of goons, his control and influence over politicians...

